    false,nt"url": null,nt"notes": "Gene rescue captive broodstock program
    was established for ESA-listed endangered Snake River sockeye salmon from Redfish
    Lake, Idaho.  The program has consisted of taking most of the remaining gene pool
    into captive culture at specialized conservation hatcheries at the Manchester Research
    Station and the Idaho Department of Fish and Game Eagle Hatchery.  Fish are being
    released to native habitats as part of recovery efforts.nnThe fork length to the
    nearest mm, weight to the nearest gram, fecundity, and green egg weight to the nearest
    mg of every female spawned is recorded. The fork length to the nearest mm, weight
    to the nearest gram, milt weight to the nearest 0.01 gram, milt volume, spermatocrit,
    and milt motility of every male spawned is recorded. The eyed egg weight and % survival
    to the eyed stage for every batch of fertilized eggs is recorded. A record is maintained
    describing which male is crossed with which female.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
